<?php

namespace Tests\Unit;

use App\Exceptions\UnexpectedImageDataException;
use App\Models\Image;
use App\Models\Ladder;
use Illuminate\Foundation\Testing\RefreshDatabase;
use Tests\TestCase;

class ImageTest extends TestCase
{
    use RefreshDatabase;

    /** @test */
    public function can_have_type()
    {
        $data = '';

        $image = Image::make([
           'data' => $data,
        ]);

        $this->assertEquals('image/jpeg', $image->getType());
    }

    /** @test */
    public function throw_on_expected_type()
    {
        $data = 'no-way';

        $image = Image::make([
            'data' => $data,
        ]);

        $this->expectException(UnexpectedImageDataException::class);

        $image->getType();
    }
}
